INSERT INTO `wp_posts` VALUES (12,1,'2024-06-05 07:12:43','2024-06-05 07:12:43','<label> NOM\r\n    [text* NOM autocomplete:name] </label>\r\n\r\n<label> E-MAIL\r\n    [email* E-MAIL autocomplete:email] </label>\r\n\r\n<label> RÉF. PHOTO\r\n    [text* reference id:reference class:reference-field] </label>\r\n\r\n<label> MESSAGE\r\n    [textarea your-message] </label>\r\n\r\n <div  class=\"submit-btn\">\r\n[submit \"Envoyer\"]\r\n </div>\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@nathalie-mota.local>\n[_site_admin_email]\nFrom: [your-name] [your-email]\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis is a notification that a contact form was submitted on your website ([_site_title] [_site_url]).\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@nathalie-mota.local>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis email is a receipt for your contact form submission on our website ([_site_title] [_site_url]) in which your email address was used. If that was not you, please ignore this message.\nReply-To: [_site_admin_email]\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nPlease fill out this field.\nThis field has a too long input.\nThis field has a too short input.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe uploaded file is too large.\nThere was an error uploading the file.\nVeuillez saisir une date au format AAAA-MM-JJ.\nLa date de ce champ est trop tôt.\nLa date de ce champ est trop tardive.\nVeuillez saisir un numéro.\nLe chiffre de ce champ est trop petit.\nCe champ a un numéro trop long.\nLa réponse à la question est incorrecte.\nVeuillez saisir votre adresse e-mail.\nVeuillez saisisr une URL\nVeuillez saisir un numéro de téléphone.','Contact form nathaliemota','','publish','closed','closed','','contact-form-1','','','2024-07-05 08:48:28','2024-07-05 08:48:28','',0,'http://nathalie-mota.local/?post_type=wpcf7_contact_form&#038;p=12',0,'wpcf7_contact_form','',0);
